import styled from 'styled-components'

const Container = styled.div`
    background-color: aquamarine;
    
`
const Btn = styled.button`
     max-width: 500px;
     min-width: 300px;
     max-height: 700px;
     width: 30%;
     height: 60%;
     margin: 100px auto;
     background-color: rgb(138, 209, 144);
     border-radius: 25px;
`
export {Container,Btn}
